    const expenseAmount = 294.67;

    return (
        <div className="expense-item">
            <div>{expseDate}</div>
            <div className="expense-item_description">
                <h2>{expenseTitle}</h2>
                <div className="expense-item_price">${expenseAmount}</div>
            </div>
        </div>
    );

}

